import React, { Component } from "react";
import {
  Grid,
  Row,
  Col,

} from "react-bootstrap";
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'

import { Card } from "components/Card/Card.jsx";
import { FormInputs } from "components/FormInputs/FormInputs.jsx";
import { UserCard } from "components/UserCard/UserCard.jsx";
// import Button from "components/CustomButton/CustomButton.jsx";

import avatar from "assets/img/faces/face-3.jpg";

class UserProfile extends Component {
  render() {
    return (
      <div className="content">
        <Grid fluid>
          <Row>
            <Col md={12}>
              <Card
                title="Ajouter Un utilisateur"
                content={

                  <Form>
                    <Form.Group controlId="formnom">
                      <Form.Label>Nom :</Form.Label>
                      <Form.Control type="text" placeholder="Enter le mon" />
                    </Form.Group>

                    <Form.Group controlId="formnom">
                      <Form.Label>Postnom :</Form.Label>
                      <Form.Control type="text" placeholder="Enter le Postnom" />
                    </Form.Group>

                    <Form.Group controlId="formnom">
                      <Form.Label>Prenom :</Form.Label>
                      <Form.Control type="text" placeholder="Enter le Prenom" />
                    </Form.Group>

                    <Form.Group controlId="formnom">
                      <Form.Label>Numéro de téléphone :</Form.Label>
                      <Form.Control type="tel" placeholder="Enter le Numéro de téléphone " />
                    </Form.Group>




                    <Form.Group controlId="exampleForm.ControlSelect1">
                      <Form.Label>Sexe</Form.Label>
                      <Form.Control as="select">
                        <option>M</option>
                        <option>F</option>

                      </Form.Control>
                    </Form.Group>
                    <Button variant="primary" size="lg" type="submit" >
                      Enregistrer
                     </Button>

                  </Form>

                }
              />
            </Col>
          </Row>
        </Grid>

        <Grid fluid>
          <Row>
            <Col md={12}>
              <Card
                title="List des agents"
                category=""
                ctTableFullWidth
                ctTableResponsive
                content={
                  <Table striped hover>
                    <thead>
                      <tr>
                        {thArray.map((prop, key) => {
                          return <th key={key}>{prop}</th>;
                        })}
                      </tr>
                    </thead>
                    <tbody>
                      {tdArray.map((prop, key) => {
                        return (
                          <tr key={key}>
                            {prop.map((prop, key) => {
                              return <td key={key}>{prop}</td>;
                            })}
                          </tr>
                        );
                      })}
                    </tbody>
                  </Table>
                }
              />
            </Col>

            <Col md={12}>
              <Card
                plain
                title="Striped Table with Hover"
                category="Here is a subtitle for this table"
                ctTableFullWidth
                ctTableResponsive
                content={
                  <Table hover>
                    <thead>
                      <tr>
                        {thArray.map((prop, key) => {
                          return <th key={key}>{prop}</th>;
                        })}
                      </tr>
                    </thead>
                    <tbody>
                      {tdArray.map((prop, key) => {
                        return (
                          <tr key={key}>
                            {prop.map((prop, key) => {
                              return <td key={key}>{prop}</td>;
                            })}
                          </tr>
                        );
                      })}
                    </tbody>
                  </Table>
                }
              />
            </Col>
          </Row>
        </Grid>


      </div>
    );
  }
}

export default UserProfile;
